actionConfiguration.body:
() => {
  let campaign = PayoutCampaignForm.formData.campaigns.fixed_percent_commission;
  let cap_amount = typeof campaign.cap_amount == "undefined" ? "NA" : campaign.cap_amount;
  let fixed_commision_string = campaign.active ? `COMMISSION: ${campaign.commission_fraction}%			 CAP_AMOUNT: ${cap_amount}` : "NA";
  return fixed_commision_string;
}

